import React, { useEffect, useState } from 'react';

function Home() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    fetch('https://fakestoreapi.com/products')
      .then((response) => response.json())
      .then((data) => {
        // Take only the first 5 products
        const firstFiveProducts = data.slice(0, 5);
        setProducts(firstFiveProducts);
        console.log(firstFiveProducts); // Optional: Log the data to see the structure
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <>
      <div style={{ width: '100%', height: '100vh' }} className='bg-primary'>
        <h1>Products</h1>
        {products.map((product) => (
          <h5 key={product.id}>{product.title}</h5>
        ))}
      </div>
    </>
  );
}

export default Home;
